import React from 'react';
import '../Styles/Skills.css'

/*************  ✨ Windsurf Command ⭐  *************/
/**
 * Displays a list of skills.
 *
 * @returns {ReactElement} The JSX Element
 */
/*******  cdb1dbe6-a373-496f-b26d-7ec289bf6062  *******/
function Skills() {
  const skills = ['JavaScript', 'React', 'Node.js', 'Express', 'MongoDB', 'TailwindCSS', 'Git', 'AWS'];

  return (
    <div className="flex flex-col items-center bg-slate-100 dark:bg-gray-700 p-6 rounded-lg shadow-md w-full md:w-1/2">
      <h2 className="text-2xl font-bold mb-4">Skills</h2>
      <ul style={{ display: 'flex', flexDirection: 'column' , textAlign: 'left'}} className="list-disc list-inside space-y-2 text-lg">
        {skills.map((skill, index) => (
          <li key={index}>{skill}</li>
        ))}
      </ul>
    </div>
  );
}

export default Skills;
